const e="Argumentation im Bild und über das Bild",t="https://uclab.fh-potsdam.de/refa-catalog/api",n="",i=["en"],s={en:"Diese Seite vereint Visualisierungen aus dem Methodenseminar Argumentation im Bild und über das Bild im Sommersemesters 2024 an der Fachhochschule Potsdam. Basierend auf kunsthistorischen Analysen einzelner Bildwerke, entwickelten Studierende eine Umsetzung der kunst- und kleiderhistorischen Thesen und Deutungsversuche, der Bildbeschreibungen und Bildvergleiche. Die verwendete Benutzeroberfläche, der ReFa-Reader, ist am UCLAB der Fachschule Potsdam im Rahmen des BMBF-geförderten Projekts Restaging Fashion (2020-2023) entstanden und wird an dieser Stelle erprobt und nachgenutzt."},a=30,d=[],r="Argumentation im Bild und über das Bild",o="https://uclab.fh-potsdam.de/refa-catalog/files/large/1dc6cd9d4a788640831fafecfd8210c50cd311e1.jpg",c={title:e,api:t,publicSite:n,languages:i,description:s,batch:a,mainCategories:d,descriptionSeo:r,imageSeo:o},l=Object.freeze(Object.defineProperty({__proto__:null,api:t,batch:a,default:c,description:s,descriptionSeo:r,imageSeo:o,languages:i,mainCategories:d,publicSite:n,title:e},Symbol.toStringTag,{value:"Module"}));export{r as a,t as b,l as c,s as d,a as e,o as i,i as l,d as m,e as t};
